import React from 'react';
import logo from './logo.svg';
import PictureCapture from "./PictureCapture";
import './App.css';

function App() {
  let snapshot = (image) => { console.log(image);}
  return (
    <div className="App">
      <PictureCapture
        onSnapshot={snapshot}
      />
    </div>
  );
}

export default App;
